Defendant Patricia J Clinton in court with attorney Matthew Adrian Lamke.  Taylor L. Kraus appeared for the State of Wisconsin.  Deputy Court Clerk ssm.  Sentencing proceeded.  Statements by the State, defense and defendant.  Defendant sentenced to serve 3 MONTHS in the House of Correction CONCURRENT to case 14CM001985; Huber privileges for work and child care.  Court STAYED the sentence and placed defendant on Probation with the State of Wisconsin, Department of Corrections for a period of 1 YEAR.
Conditions: 
*  Pay a fine of $100.00 including costs at the rate of $25.00 per month commencing April 11, 2016 or, if not paid, convert to a civil judgment;
*  Maintain full time employment;
*  Establish paternity for child(ren);
*  Submit a DNA sample and pay the DNA surcharge or, if not paid, convert to a civil judgment.

Court set restitution at $0.00.  Court will grants expungement upon successful completion of probation and no new crimes.
